<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01//EN" "http://www.w3.org/TR/html4/strict.dtd"><html><head><title></title><meta http-equiv="Content-Type" content="text/html; charset=utf-8"><script type="text/javascript">function gup(b){b=b.replace(/[\[]/,"\\[").replace(/[\]]/,"\\]");var a="[\\?&]"+b+"=([^&#]*)";var d=new RegExp(a);var c=d.exec(window.location.href);if(c){return c[1]}else{return""}}var interval;function sendData2Master(){var a=window.parent.parent;try{if(a.XDTMaster){var b=a.XDTMaster.read([gup("cmd"),gup("data")]);window.clearInterval(interval)}}catch(c){}}function OnMessage(c){var b=c.data;var a=window.parent.parent;a.XDTMaster.read(["end",b,"fpm"])}function listenPostMessage(){if(window.addEventListener){window.addEventListener("message",OnMessage,false)}else{if(window.attachEvent){window.attachEvent("onmessage",OnMessage)}}}function onLoad(){interval=window.setInterval(sendData2Master,100);listenPostMessage()};</script></head><body onload="onLoad()"><p></p></body></html>
